import ExpenseItem from "./ExpenseItem";
import Card from "./Card";
import items from "../items";
import "./Expenses.css";

function Expenses(props) {
  return (
    <Card className="expenses">
      {items.map((expense) => {
        return (
          <div className="expenses">
            <ExpenseItem
              date={expense.date}
              title={expense.title}
              amount={expense.amount}
            />
          </div>
        );
      })}
    </Card>
  );
}

export default Expenses;
